import { useEffect, useState} from "react"
const Students = ()=>{
const url = 'http://localhost:8080/v1/student'
const [students, setStudents] = useState([]);

const getDataStudents = async ()=> {
    const response = await fetch(url)
    const dataStudent = await response.json();
   setStudents(dataStudent);
   console.log(dataStudent);
}

useEffect(() =>{
    getDataStudents();
},[])

return (
    <div>
    <h1>My Students</h1>
    {/* Tampilkan data students di sini */}
    {students.map(student => (
      <div key={student.id}>
        <p>{student.name}</p>
        {/* Tambahkan elemen lain yang sesuai dengan data siswa */}
      </div>
    ))}
  </div>
)
}

export default Students;
